import { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { signin } from "../../services/Student";
import img from "../../images/User/logn.jpg";
import { ToastContainer, toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";

function Login() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [role, setRole] = useState("Student"); // Default role

  // get the navigate function
  const navigate = useNavigate();

  const onLogin = async () => {
    if (email.length === 0) {
      toast.warn("Please enter email");
    } else if (password.length === 0) {
      toast.warn("Please enter password");
    } else {
      // call the signin api
      const result = await signin(email, password, role);

      // check if the result is successful
      if (result.status === "success") {
        toast.success("Welcome");

        // get the user details
        const { firstName, lastName, phone, token } = result.data;

        // cache the user details in session storage
        sessionStorage["name"] = `${firstName} ${lastName}`;
        sessionStorage["token"] = token;
        sessionStorage["phone"] = phone;
        sessionStorage.setItem("email", email);

        // go to home screen
        navigate("/userDashboard");
      } else {
        toast.error(result.error || "Login failed");
      }
    }
  };

  return (
    <>
      <ToastContainer position="top-right" autoClose={3000} />
      <div
        style={{
          backgroundImage: `url(${img})`,
          backgroundSize: "cover",
          backgroundPosition: "center",
          height: "400px",
        }}
      >
        <div>
          <div className="row">
            <div className="col"></div>
            <div
              className="col"
              style={{
                backgroundColor: "white",
                height: "500px",
                marginTop: "70px",
              }}
            >
              <div className="flex justify-center mt-4">
                <span className="bg-yellow-100 text-yellow-800 text-lg font-medium me-2 px-10.5 py-7.5 rounded-sm dark:bg-yellow-900 dark:text-yellow-300">
                  Login
                </span>
              </div>
              <div className="mb-3">
                <label htmlFor="">
                  <b>Email</b>
                </label>
                <input
                  onChange={(e) => setEmail(e.target.value)}
                  type="email"
                  className="form-control"
                />
              </div>
              <div className="mb-3">
                <label htmlFor="">
                  <b>Password</b>
                </label>
                <input
                  onChange={(e) => setPassword(e.target.value)}
                  type="password"
                  className="form-control"
                />
              </div>
              <div className="mb-3">
                <label htmlFor="">
                  <b>Role</b>
                </label>
                <select
                  className="form-control"
                  onChange={(e) => setRole(e.target.value)}
                >
                  <option value="Admin">Admin</option>
                  <option value="Student">Student</option>
                </select>
              </div>
              <div className="mt-3">
                <div>
                  <b> Don't have an account? </b>
                  <a
                    href="/register"
                    className="font-medium text-blue-600 dark:text-blue-500 hover:underline"
                  >
                    Register here!
                  </a>
                </div>
                <button onClick={onLogin} className="btn btn-success mt-3">
                  Login
                </button>
              </div>
            </div>
            <div className="col"></div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Login;
